    false,nt"url": null,nt"notes": "This narrative report for Long Lake NWR
    outlines Refuge accomplishments from September through December of 1962. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    fish, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, and wildfires. Resource management is
    outlined; topics include grazing, haying, and fur harvesting. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, and safety. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
